import '../styles/Process.scss'

function Process() {
    return(
        <section className="process-section">
            <div className="title-container">
                <hr className="title-bar"/>
                <h2 className="process-title">HOW WE WORK</h2>
            </div>
        </section>
    )
}

export default Process
